import React, { useState, useEffect } from 'react';
import { Grid, Form, Button, Radio, FormInput, FormGroup, FormField, Accordion, FormCheckbox, GridColumn, Segment, Input, Table, Modal, Header } from 'semantic-ui-react';
import { NavLink } from 'react-router-dom';

function AccountSettingsForm({ users, userUsernameSearch, handleInputChange, handleDeleteUser, handleToggleUserStatus, handleSearchUser }) {
  const [modalOpen, setModalOpen] = useState(false);
  const [userToDelete, setUserToDelete] = useState(null);
  const [userActivationStatus, setUserActivationStatus] = useState({});
  const [currentPassword, setCurrentPassword] = useState('');
  const [newPassword, setNewPassword] = useState('');

  const handleChange = (e, { name, value }) => {
    if (name === 'currentPassword') {
      setCurrentPassword(value);
    } else if (name === 'newPassword') {
      setNewPassword(value);
    }
  };

  const handleApply = () => {
    // Здесь можно добавить логику для изменения пароля
    // например, отправка запроса на сервер
    setModalOpen(false);
    setCurrentPassword('');
    setNewPassword('');
  };

  const panels = [
    {
      key: 'privacy',
      title: 'Настройки приватности',
      content: {
        content: (
          <Form>
            <Form.Field>
              <label>Email</label>
              <input placeholder='email@gmail.com' />
            </Form.Field>
            <Form.Field>
              <FormCheckbox label='Присылать уведомления по Email' name='privacy' />
            </Form.Field>
            <Form.Field>
              <label>Номер телефона</label>
              <input placeholder='+79876543210' />
            </Form.Field>
            <Form.Field>
              <FormCheckbox label='Присылать уведомления в «Telegram»' name='privacy' />
            </Form.Field>
            <Button onClick={() => setModalOpen(true)}>Изменить пароль</Button>
          </Form>
        ),
      },
    },
  ];

  return (
    <>
      <Grid stackable divided>
        <GridColumn>
          <Form>
            <Modal
              onClose={() => setModalOpen(false)}
              onOpen={() => setModalOpen(true)}
              open={modalOpen}
              trigger={<Button>Открыть модальное окно</Button>}
            >
              <Modal.Header>Изменить пароль</Modal.Header>
              <Modal.Content>
                <Form>
                  <Form.Field>
                    <label>Текущий пароль</label>
                    <input
                      name='currentPassword'
                      value={currentPassword}
                      onChange={handleChange}
                      type='password'
                    />
                  </Form.Field>
                  <Form.Field>
                    <label>Новый пароль</label>
                    <input
                      name='newPassword'
                      value={newPassword}
                      onChange={handleChange}
                      type='password'
                    />
                  </Form.Field>
                </Form>
              </Modal.Content>
              <Modal.Actions>
                <Button color='black' onClick={() => setModalOpen(false)}>Отмена</Button>
                <Button
                  content='Применить'
                  labelPosition='right'
                  icon='checkmark'
                  onClick={handleApply}
                  positive
                />
              </Modal.Actions>
            </Modal>

            <Accordion as={FormField} panels={panels} />

          </Form>
        </GridColumn>
      </Grid>
    </>
  );
}

export default AccountSettingsForm;
